import { useEffect, useState } from "react";
function Main(){

    const [topics, setTopics] = useState()

    useEffect(()=>{
        fetch('http://127.0.0.1:8000/quizapp/get_topics')
        .then(res=>res.json())
        .then(data=>{
            setTopics(data)
        })
    },[])

    console.log(topics)
    return(
        <div>

        </div>
    )
}
export default Main;
